import React from "react";
import {Tile} from "../../components/tile/Tile";

const arr=Object.values(props.appointment)

export const TileList = () => {

  return (
    <div>
    
    {arr.map((obj,i)=>{

      const{name,...description}=obj
    
   return  <Tile name={name} description={description} key={i}/>


    })



    }
    </div>
  );
};
